const ConvertDataForLineChart = (dataArray) => {
    const convertedData = [];

    dataArray.forEach((eventsArray) => {
      eventsArray.forEach((event) => {
        const eventType = event.EventType;
        const startTimestamp = new Date(event.Start);
        const endTimestamp = new Date(event.End);

        // Adiciona um objeto ao array convertido com as informações do evento
        convertedData.push({
          x: { start: startTimestamp, end: endTimestamp }, // Objeto com tempo de início e fim
          y: eventType, // Nome do evento
        });
      });
    });
    console.log(convertedData)
    return convertedData;
  };

  export default ConvertDataForLineChart;
